"""
LeetCode :: March 2022 Challenge :: 1007. Minimum Domino Rotations For Equal Row
jramaswami
"""


import math


TOP = 0
BOTTOM = 1


class Solution:

    def minDominoRotations(self, tops, bottoms):
        def flipped(i):
            return (bottoms[i], tops[i])

        def unflipped(i):
            return (tops[i], bottoms[i])

        def cost_to_match(i, side, value_to_match):
            if unflipped(i)[side] == value_to_match:
                return 0
            if flipped(i)[side] == value_to_match:
                return 1
            return math.inf

        def solve(side):
            value_to_match = unflipped(0)[side]
            cost = 0
            for i, _ in enumerate(tops[1:], start=1):
                cost += cost_to_match(i, side, value_to_match)
            return cost

        soln = min(solve(TOP), solve(BOTTOM))
        tops[0], bottoms[0] = bottoms[0], tops[0]
        soln = min(soln, 1 + solve(TOP), 1 + solve(BOTTOM))
        tops[0], bottoms[0] = bottoms[0], tops[0]
        return (-1 if soln == math.inf else soln)


def test_1():
    tops = [2,1,2,4,2,2]
    bottoms = [5,2,6,2,3,2]
    expected = 2
    assert Solution().minDominoRotations(tops, bottoms) == expected


def test_2():
    tops = [3,5,1,2,3]
    bottoms = [3,6,3,3,4]
    expected = -1
    assert Solution().minDominoRotations(tops, bottoms) == expected


def test_3():
    tops =    [3, 1, 1, 1, 1, 1]
    bottoms = [1, 1, 3, 4, 5, 6]
    expected = 1
    assert Solution().minDominoRotations(tops, bottoms) == expected


